hash_search_result HashSearch(s_flow HashTable[N],int HashaddrIndex[N],s_flow &flowtuple, int addr[2])
{
		s_flow p;
		int count = 0;
		//int count1 = 1;
		int count2 = 2;
		hash_search_result h;
		//int addr = myhash(flowtuple, d)%N;
		//addr = addr%N;
		p = HashTable[addr[0]];
		//int addr;
		if (p.sip==0) {
			h.count = count;
			h.result = false;
	//		count = -1;
			return h;
		}
		if (p.sip == flowtuple.sip&&p.dip == flowtuple.dip&&p.sport == flowtuple.sport&&p.dport == flowtuple.dport&&p.protocol == flowtuple.protocol) {
			h.count = count;
			h.result = true;
		}
		else {
			p = HashTable[addr[1]];
			count2 = count++;
			if (p.sip==0) {
				h.count = count2;
				h.result = false;
				//		count = -1;
				return h;
			}
			else if (p.sip == flowtuple.sip&&p.dip == flowtuple.dip&&p.sport == flowtuple.sport&&p.dport == flowtuple.dport&&p.protocol == flowtuple.protocol) {
				h.count = count2;
				h.result = true;
			}
			else{
				h.count = count2++;
				h.result = false;
			}
		}
		return h;
}

